import React from 'react';
import styled from 'styled-components'
import ToolBar from './Pages/ToolBar'
import Image from './Pages/Image'

const OutsideContainer = styled.div`
  width:50vw;
  height:50vh;
  background:yellow;
  display:table-cell;
  vertical-align:middle;
  text-align:center;
`

function App() {
  return (
   <outsideContainer>
     <ToolBar></ToolBar>
     <Image></Image>
   </outsideContainer>
  );
}

export default App;
